	lives:	.word	0x24200D, 0xEEEEEE, 0x24200D, 0xFEB804, 0xFEB804, 0xFEB804, 0xEEEEEE, 0xFA5646, 0xEEEEEE
	seed:	.word	0x000000, 0x000000, 0xD28F00, 0x000000, 0x000000, 0x000000, 0x000000, 0xD28F00, 0xFFFFFF, 0xD28F00, 0x000000, 0x000000, 0xD28F00, 0xFAB31B, 0xFAB31B, 0xFFFFFF, 0xD28F00, 0x000000, 0xD28F00, 0xFAB31B, 0xFAB31B, 0xFFFFFF, 0xD28F00, 0x000000, 0xD28F00, 0xFAB31B, 0xFAB31B, 0xFAB31B, 0xD28F00, 0x000000, 0x000000, 0xD28F00, 0xD28F00, 0xD28F00, 0x000000, 0x000000

### Game Data ###						
levelBG:		.word	0xB4D5D5, 0x74AD73, 0xCAAC79	# stores the background colour of the current level, initially level1
platformColour:		.word	0x967243, 0x623A19, 0x633D25	# stores the platform colours of each level
killColour:		.word 	0xFFFFFF, 0xE9EC07, 0x2C6C11	# stores the colour of objects that kill you in each level
spawn:			.word	0x1000B310, 0x10009FE4, 0x1000BA00	# stores spawn location of each level
level:			.word	0			# stores the current level, lvl 1 = 0, lvl 2 = 4, lvl 3 = 8
hovering:		.word	0			# stores what the player is hovering in the start menu (0 = play, 1 = quit)
lastLocation:		.word	0x10008000		# players previous memory location
playerLocation:		.word 	0x10008000		# players's top left corner location in memory
direction:		.word	0			# stores player's x axis direction (-4 = left, 0 = not moving, 4 = right)
jumping:		.word	0			# Stage of player's jump (-256 = jump, 0 = none, 256 = fall)
jumpCount:		.word	6			# counts down on how much more movements left on their jump (6:0)	
health:			.word	8			# stores players current health (-4 = lose) 
seedcount:		.word	0			# stores the num of seeds the player has (increases a life and changes your sprite)
spritestage:		.word 	0			# stores the stage the sprite is on
isSoy:			.word	0			# stores if our chicken has the soy sauce effect or not (0 for false, 1 for true)
glide:			.word 	-1			# stores glide ( -1 = powerup not obtained, 1-0 = if we already waited to fall or not)
doublejump:		.word	-1			# stores doublejump (-1 = not obtained, 1 = can jump again, 0 = already jumped again)
frameRate:		.word	0			# the variable for sleep length in game
debug:			.asciiz "Help!"
newline:		.asciiz "\n"

.eqv	DEFAULT_FRAME_RATE,	50		# 50ms refresh for default framerate
.eqv    BASE_ADDRESS,		0x10008000	# base address for display
.eqv    MAX_ADDRESS,		0x1000c000	# max address for display
.eqv	MENUSELECTCOLOUR,	0xFD711C	# orange for the cursor in the menu
.eqv	WHITE,			0xFFFFFF	# stores white colour
.eqv	BLACK,			0x000000	# black colour, for winning
.eqv	SEED,			0xD28F00	# colour of the seed border
.eqv	BUTTON, 		0x00ADBB	# colour of the button in level 1
.eqv	SOY,			0xFF0000	# colour of the soy bottle in level 2

.text
.globl main
main:           
	li $s0,	BASE_ADDRESS			# load first pixel of bitmap display to $s0
   	li $s1,	MAX_ADDRESS			# loads last pixel + 1 of bitmap display to $s2
   	li $t0, DEFAULT_FRAME_RATE		# $t0 = DEFAULT_FRAME_RATE (default = 50)
   	sw $t0, frameRate			# frameRate = $t0
   	sw $zero, seedcount

#loads our start menu
loadStartMenu:					# loads start menu screen to bitmap display
	la $t0, 0($s0)				# t0 our cursor, set to start location
    	la $t1, StartMenu			# $t1 = StartMenu, puts image in t1
    	sw $zero, seedcount			# initializes seedcount to 0
	drawStartMenu:
   		bge $t0, $s1, hoverStart		# stop when cursor is = max address
    		lw $t2, 0($t1)				# $t2 = 0($t1), load pixel from image
    		sw $t2, 0($t0)				# $t2 = 0($t0), puts pixel into bitmap
    		addi $t0, $t0, 4			# increments our vars to the next pixel
    		addi $t1, $t1, 4			
	j drawStartMenu
	hoverStart:
		li $t1, MENUSELECTCOLOUR		#get the orange pixel
		#restore QUIT pixels
		li $t2, WHITE
		sw $t2,	14700($s0)			
		sw $t2, 14704($s0)
		sw $t2, 14708($s0)
		#now colour the start pixels orange
		sw $t1, 12396($s0)			
		sw $t1, 12400($s0)
		sw $t1, 12404($s0)
		li $t0, 0		# Set hovering to 0 (represents play)
		sw $t0, hovering
		j MenuWait			
	hoverQuit:
		li $t1, MENUSELECTCOLOUR		#get the orange pixel
		# restore START pixels
		li $t2, WHITE
		sw $t2, 12396($s0)
		sw $t2, 12400($s0)
		sw $t2, 12404($s0)
		#now colour those pixels orange
		sw $t1, 14700($s0)
		sw $t1, 14704($s0)
		sw $t1, 14708($s0)
		li $t0, 1		# Set hovering to 1 (represents quit)
		sw $t0, hovering
		j MenuWait
	MenuWait:					# Menu loop to wait for keyboard input
		li $t9, 0xffff0000			# keeps making sure t9 is keyboard
		lw $t8, 0($t9)				# t8 = 1 if input detected, 0 if no input detected
		beq $t8, 1, MenuKeys			# if input detected, go evaluate it in menukeys
		j MenuWait
	MenuKeys:
		lw $t2, 4($t9) 					# gets keyboard value from $t9, assuming t9 is set to 0xfff0000 from before
		beq $t2, 0x77, hoverStart			# 'w' is 0x77, hovered start
		beq $t2, 0x73, hoverQuit			# 's' is 0x73, hoevered quit
		beq $t2, 0x20, select 				# ' ' is 0x20, selected an option
		j MenuWait					# go back and do nothing if invalid keys
	select:
		lw $t1, hovering	#Check hovering's value
		beq $t1, 0, gameSetup	# 0 to start
		j quit			# 1 to quit

gameSetup: 
	lw $t2, health
	bltz $t2, loadFried	# if we have negative health, lose.
   	sw $zero, direction
   	sw $zero, jumping
   	li $t1, 6
   	sw $t1, jumpCount
	lw $t0, level
	lw $t2, seedcount
	bge $t2, $t0, skipSeedUpdate # dont update seed if it's greater than level
	sw $t0, seedcount #otherwise set it to the level
	skipSeedUpdate:
	beqz $t0, loadLevel1 # if level is 0, go to level 1
	li $t3, 4
	beq $t0, $t3, loadLevel2 # if level is 4, go to level 2
	li $t3, 8
	beq $t0, $t3, loadLevel3 # if level is 8, go to level 3
	j loadWinScreen	# if we have no more levels, we win!!

loadLevel1:
	la $t0, 0($s0)
    	la $t1, level1
	drawLevel1:		# draw level 1 screen
   	bge $t0, $s1, level1drawn
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j drawLevel1
	level1drawn:
	# set player location to spawn
	lw $t0, spawn
	sw $t0, playerLocation
	sw $t0, lastLocation
	jal setChicken
	j setLives

loadLevel2:
	la $t0, 0($s0)
    	la $t1, level2
	drawLevel2:		# draw level 2 screen
   	bge $t0, $s1, level2drawn
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j drawLevel2
	level2drawn:
	# set player location to spawn
	la $t0, spawn
	addi $t0, $t0, 4
	lw $t0, 0($t0)
	sw $t0, playerLocation
	sw $t0, lastLocation
	jal setChicken
	j setLives
	
loadLevel3:
	la $t0, 0($s0)
    	la $t1, level3
	drawLevel3:		# draw level 3 screen
   	bge $t0, $s1, level3drawn
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j drawLevel3
	level3drawn:
	# set player location to spawn
	la $t0, spawn
	addi $t0, $t0, 8
	lw $t0, 0($t0)
	sw $t0, playerLocation
	sw $t0, lastLocation
	jal setChicken

setLives:
	lw $t0, health			# load current player's health
	# draw as many lives as healths
	la $t1, lives
	li $t2, 0 # iterating reg for num lives
	li, $t3, BASE_ADDRESS
	addi $t3, $t3, 15364
	drawLife:
		bge, $t2, $t0, eraseSeed # if the amt we drew is equal to our health, continue
		lw $t4, 0($t1) # take pixel and draw 
		sw $t4, 0($t3)
		lw $t4, 4($t1) # take pixel and draw 
		sw $t4, 4($t3)
		lw $t4, 8($t1) # take pixel and draw 
		sw $t4, 8($t3)
		lw $t4, 12($t1) # take pixel and draw 
		sw $t4, 256($t3)
		lw $t4, 16($t1) # take pixel and draw 
		sw $t4, 260($t3)
		lw $t4, 20($t1) # take pixel and draw 
		sw $t4, 264($t3)
		lw $t4, 24($t1) # take pixel and draw 
		sw $t4, 512($t3)
		lw $t4, 28($t1) # take pixel and draw 
		sw $t4, 516($t3)
		lw $t4, 32($t1) # take pixel and draw 
		sw $t4, 520($t3)
		addi $t3, $t3, 16	# go to next life position
		addi $t2, $t2, 4
		j drawLife

eraseSeed: # erase the seed
	lw $t1, seedcount
	lw $t0, level
	ble $t1, $t0, game	# dont erase if we haven't gotten the seed for this level yet
	li $t1, BASE_ADDRESS
	# erase the seed depending on the level
	beqz $t0, seed1loc
	li $t2, 4
	beq $t2, $t0, seed2loc
	#otherwise theres no seed so skip
	j game
	seed1loc:
		addi $t1, $t1, 1512
		j erasingSeed
	seed2loc:
		addi $t1, $t1, 10860
	erasingSeed:
	# getting the background colour
	la $t6, levelBG
	add $t6, $t6, $t0
	lw $t4, 0($t6)

	li $t7, 24
	li $t2, 0
	drawseed:
		li $t3, 0
		drawseedrow: # draw this row's
			sw $t4, 0($t1)
			addi $t0, $t0, 4
			addi $t1, $t1, 4
			addi, $t3, $t3, 4
   			blt $t3, $t7, drawseedrow # repeat if less than 6 times loop
   		addi $t2, $t2, 4
   		sub $t1, $t1, 24	# goes back to first pix in the row
   		add $t1, $t1, 256	# go to next row
   		blt $t2, $t7, drawseed	# repeat if less than 6 times loop

game:
	li $t9, 0xffff0000		# Check keyboard input
	lw $t8, 0($t9)
	beq $t8, 0, noInput
	jal keypressed

	noInput:
	lw $t1, playerLocation
	sw $t1, lastLocation
	lw $t0, level

	jal calculateMovement		# calculates players new location & if collision
	lw $t2, playerLocation
	beq $t1, $t2, skipMove 	# only redraw if chicken has moved
	jal removeChicken
	li $t4, 8
	beq $t0, $t4, allLevelChecks # skip the checks that only apply to first 2 lvls if lvl 3
	# checks if player reached the seed, or a unique obj in level1/2 (1 is button, 2 is soy sauce)
	jal checkObj
	jal checkSeed
	beqz $t0, allLevelChecks # skips the unique powerup check in level 2 and 3 if we are level 1
	jal checkPowerup
	allLevelChecks: # checks for damage, or winning, which every level has
	jal checkWin			# check if player has won the level
	jal checkDamage
	# move the chicken
	jal setChicken
	skipMove:
	sleep:
	lw $t0, frameRate		# sleeps game for 'frameRate' miliseconds
	li $v0, 32			# system call for sleep
	move $a0, $t0
	syscall
	j game

keypressed:
	lw $t0, 4($t9) 			# reads the keyboard input
	beq $t0, 0x71, quit 		# if q is pressed, quit game
	beq $t0, 0x72, reset 		# if r is pressed, go back to start menu
	beq $t0, 0x77, jump 		# if w is pressed, jump
	beq $t0, 0x61, left 	# if a is pressed, set left
	beq $t0, 0x73, stop 	# if s is pressed, stop moving horizontally
	beq $t0, 0x64, right 	# if d is pressed, move right
	jr $ra	# if not one of those keys, just go back dont change anything
	left:
		li $t1, -4
		sw $t1, direction
		jr $ra
	right:
		li $t1, 4
		sw $t1, direction
		jr $ra
	stop:
		sw $zero, direction
		jr $ra
	jump:
		lw $t0, jumping
		bnez $t0, ignore_jump	# Jump state must be 0 to jump (player is landed on ground)
		li $t1, -256
		sw $t1, jumping
		ignore_jump:
		jr $ra

calculateMovement:
	lw $t0, playerLocation		# gets player current location
	lw $t1, direction		# gets players horizontal direction
	beqz $t1, hitPlatform		# skip to jump movements if not moving l/r
					#i go to hitPlatform just to set some things	
	add $t1, $t0, $t1		# adds the direction to the player's location
	checkH:
		lw $t3, level
		la $t2, platformColour # gets the platform colour
		add $t2, $t2, $t3
		lw $t2, 0($t2)
		#checks to see if the players potential location, the 4 corners, will hit a platform
		#also checks to see if the players potential position goes out of screen
		lw $t5, direction
		bgtz $t5, rightCheck		# if moving right, skip
		li $t4, 256			# check if at left edge
		div $t0, $t4
		mfhi $t4			
		beq $t4, 0, hitPlatform		# dont move left if at left edge
		#check player left side
		lw $t3, 0($t1)	# get the pixel at that location
		beq $t3, $t2, hitPlatform
		lw $t3, 256($t1)
		beq $t3, $t2, hitPlatform
		lw $t3, 512($t1)
		beq $t3, $t2, hitPlatform
		lw $t3, 768($t1)
		beq $t3, $t2, hitPlatform
		lw $t3, 1024($t1)
		beq $t3, $t2, hitPlatform
		rightCheck:
		bltz $t5, doneCheckH		# only check this if moving right
		li $t4, 256			# check if at right edge
		addi $t6, $t0, 16
		div $t6, $t4
		mfhi $t4
		beq $t4, 252, hitPlatform	# dont move if at right edge
		#check player right side
		lw $t3, 16($t1)
		beq $t3, $t2, hitPlatform
		lw $t3, 272($t1)
		beq $t3, $t2, hitPlatform
		lw $t3, 528($t1)
		beq $t3, $t2, hitPlatform
		lw $t3, 784($t1)
		beq $t3, $t2, hitPlatform	
		lw $t3, 1040($t1)
		beq $t3, $t2, hitPlatform
		doneCheckH:
		# if no collision
		lw $t0, playerLocation
		add $t0, $t0, $t5
		sw $t0, playerLocation	# commit this location
		j checkJump	# now check our jump
		hitPlatform: # if collision
			sw $zero, direction	# stop moving l/r
	checkJump:
	lw $t1, jumping # get the jump stage
	bnez $t1, checkJumpCollision # if we're either jumping or falling, continue
	# check if we're still standing on a platform
	lw $t0, playerLocation		# regetting player location since i messed with it earlier
	addi $t0, $t0, 1280		# checks pixels under player
	lw $t2, 0($t0)			# gets pixel colour
	lw $t4, level
	la $t3, platformColour # gets the platform colour
	add $t3, $t3, $t4
	lw $t3, 0($t3)
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 4($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 8($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 12($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 16($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	# if we're not on a platform now, but we weren't jumping or falling
	# it means we walked off, so start falling
	j fall
	checkJumpCollision:
		lw $t1, jumping
		bgt $t1, 0, player_fall		# if we aren't jumping, skip and go to falling
		lw $t5, level
		la $t4, platformColour # gets the platform colour
		add $t4, $t4, $t5
		lw $t4, 0($t4)
		li $t2, 256			# checks if the player is the top row
		lw $t0, playerLocation		# regetting player location since i messed with it earlier
		add $t3, $t0, -0x10008000	
		div $t3, $t2
		mflo $t2
		ble $t2, $zero, fall	# if so, make player fall
		lw $t0, playerLocation		# regetting player location since i messed with it earlier
		addi $t0, $t0, -256	# gets the pixel address above the player
		lw $t2, 0($t0)		# gets the pixel colour there
		beq $t2, $t4, fall	# compares pixel colour to platform colour, if same, fall
		addi $t0, $t0, 4	# gets the pixel address of the middle top of the player
		lw $t2, 0($t0)		# gets the pixel colour there
		beq $t2, $t4, fall
		addi $t0, $t0, 4	# gets the pixel address of the middle top of the player
		lw $t2, 0($t0)		# gets the pixel colour there
		beq $t2, $t4, fall	# compares pixel colour to platform colour, if same, fall
		addi $t0, $t0, 4	# gets the pixel address of the other top corner of the player
		lw $t2, 0($t0)		# gets the pixel colour there
		beq $t2, $t4, fall	# compares pixel colour to platform colour, if same, fall
		addi $t0, $t0, 4	# gets the pixel address of the other top corner of the player
		lw $t2, 0($t0)		# gets the pixel colour there
		beq $t2, $t4, fall	# compares pixel colour to platform colour, if same, fall
		lw $t5, jumpCount	# loads our jump count
		ble $t5, $zero, fall	# if we have no more jump pixels, fall :(
		# otherwise, we will jump up a pixel
		addi $t5, $t5, -1		# since we will jump up one, reduces by one
		sw $t5, jumpCount		# saves the new remaining jump count
		lw $t0, playerLocation
		add $t0, $t0, $t1
		sw $t0, playerLocation		# save new jump position 
		jr $ra	# return
	fall:
	li $t1, 256			# set jump stage to 256 (falling)
	sw $t1, jumping
	player_fall:
	lw $t0, glide			# checks the glide
	ble $t0, $zero, falling		# if we have a glide don't fall yet
	addi $t0, $t0, -1		# reduce our glide count
	sw $t0, glide
	jr $ra
	falling:
	lw $t0, playerLocation		# regetting player location since i messed with it earlier
	addi $t0, $t0, 1280		# checks pixels under player
	lw $t2, 0($t0)			# gets pixel colour
	lw $t4, level
	la $t3, platformColour # gets the platform colour
	add $t3, $t3, $t4
	lw $t3, 0($t3)
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 4($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 8($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 12($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t2, 16($t0)			# gets pixel colour
	beq $t2, $t3, landed		# if we're standing on a platform, we landed
	lw $t0, playerLocation
	addi $t0, $t0, 256
	sw $t0, playerLocation		# save new position in playerLocation
	lw $t0, glide			# if we just fell, and we have glide powerup, reset our glide
	beqz $t0, resetGlide
	j doneVerticalCalc
	landed:
	sw $zero, jumping # set to not jumping or falling
	li $t5, 6
	sw $t5, jumpCount	# refresh the jump count
	bnez $t0, doneVerticalCalc
	resetGlide:
	li $t0, 2
	sw $t0, glide
	doneVerticalCalc:
	jr $ra	# return
	

removeChicken:
	lw $t4, lastLocation
	lw $t1, level			# replace chicken with current level's background colour
	la $t2, levelBG	
	add $t2, $t2, $t1
	lw $t2, 0($t2)
	li $t1, 20
	li $t3, 0
	erasechicken:
		sw $t2, 0($t4)
		sw $t2, 4($t4)
		sw $t2, 8($t4)
		sw $t2, 12($t4)
		sw $t2, 16($t4)
		addi $t3, $t3, 4
   		add $t4, $t4, 256	# go to next row
   		blt $t3, $t1, erasechicken	# repeat if less than 5 times loop
	jr $ra

setChicken:
	lw $t5, playerLocation
	lw $t7, spritestage
	li $t8, 4
	beqz $t7, setEgg # select the sprite depending on the sprite stage
	beq $t7, $t8, setChick
	# if more, then we are a chicken
	la $t0, chicken
	j preparingChicken
	setEgg:
		la $t0, egg
		j preparingChicken
	setChick:
		la $t0, chick
	preparingChicken:
	lw $t7, level			# getting the background colour
	la $t6, levelBG	
	add $t6, $t6, $t7
	lw $t6, 0($t6)

	li $t1, 20
	li $t2, 0
	drawchicken:
		li $t3, 0
		drawchickenrow: # draw this row's 5 pixels
			lw $t4, 0($t0)
			bne $t4, BLACK, drawchickenpix
			move $t4, $t6	# if the pixel is black, replace with the level bg
			drawchickenpix:
			sw $t4, 0($t5)
			addi $t0, $t0, 4
			addi $t5, $t5, 4
			addi, $t3, $t3, 4
   			blt $t3, $t1, drawchickenrow # repeat if less than 5 times loop
   		addi $t2, $t2, 4
   		sub $t5, $t5, 20	# goes back to first pix in the row
   		add $t5, $t5, 256	# go to next row
   		blt $t2, $t1, drawchicken	# repeat if less than 5 times loop
   	lw $t1, isSoy
   	bnez $t1, drawSoy	# if we have the soy effect, draw it
	jr $ra
	drawSoy:
	# just manually draws the soy, its not that many pixels its ok
	lw $t0, playerLocation
	li $t1, 0x821D1D
	sw $t1, 4($t0)
	sw $t1, 8($t0)
	sw $t1, 12($t0)
	sw $t1, 256($t0)
	sw $t1, 260($t0)
	sw $t1, 264($t0)
	sw $t1, 268($t0)
	sw $t1, 272($t0)
	sw $t1, 516($t0)
	sw $t1, 520($t0)
	sw $t1, 524($t0)
	sw $t1, 772($t0)
	jr $ra

checkObj: # check if any of the corners of the player are touching the door key/button
	# do appropriate action accordingly
	lw $t0, level
	bnez $t0, soycheck	# the below is for lvl 1 button, skip if we're on lvl 2
	li $t2, BUTTON
	# compares the 4 corners to the win obj colour
	lw $t1, playerLocation
	lw $t3, 0($t1)
	beq $t3, $t2, eraseObj # if any of them touch, then erase the win obj and unlock
	lw $t3, 1024($t1)
	beq $t3, $t2, eraseObj
	lw $t3, 16($t1)
	beq $t3, $t2, eraseObj
	lw $t3, 1044($t1)
	beq $t3, $t2, eraseObj
	jr $ra	# if not then go back
	soycheck:
	li $t2, SOY
	# compares the 4 corners to the obj colour
	lw $t1, playerLocation
	lw $t3, 0($t1)
	beq $t3, $t2, eraseObj # if any of them touch, then erase the obj
	lw $t3, 1024($t1)
	beq $t3, $t2, eraseObj
	lw $t3, 16($t1)
	beq $t3, $t2, eraseObj
	lw $t3, 1040($t1)
	beq $t3, $t2, eraseObj
	jr $ra	# if not then go back
	eraseObj:
	la $t2, levelBG		# obtains the correct level BG
	add $t2, $t2, $t0
	lw $t2, 0($t2)
	beqz $t0, eraseObj1 # erase level 1's object
	# else erase lvl 2's obj
	li $t4, BASE_ADDRESS
	addi $t4, $t4, 7772 # gets top left corner of Obj2
	li $t5, 16 # max rows
	li $t7, 24 # max cols
	j erasing
	eraseObj1:
	li $t4, BASE_ADDRESS
	addi $t4, $t4, 356 # gets top left corner of Obj1
	li $t5, 36 # max rows
	li $t7, 36 # max cols
	erasing:
		li $t3, 0	# let t3 be the row iterating variable
		eraseObjCol:
			li $t6, 0 # iterating col variable
			eraseObjRow:
				sw $t2, 0($t4)
				addi $t4, $t4, 4
				addi $t6, $t6, 4
				blt $t6, $t5, eraseObjRow # repeat if less than max col
			addi, $t3, $t3, 4
			sub, $t4, $t4, $t5
   			add $t4, $t4, 256	# go to next row
   			blt $t3, $t7, eraseObjCol	# repeat if less than max row times loop
   	beqz $t0, openDoor1	# if we're level one open the door
   	# otherwise we now apply the soy sauce effect
   	li $t0, 1
   	sw $t0, isSoy
   	li $t0, 0x623A19
   	sw $t0, -752($t4)
   	sw $t0, -496($t4)
   	sw $t0, -240($t4)
   	sw $t0, 16($t4)
   	jr $ra
	openDoor1:
		li $t4, BASE_ADDRESS
		addi $t4, $t4, 3600 # gets top left corner of door 1
		li $t3, 0	# let t3 be the iterating variable
		li $t5, 52 # max rows
		li $t2, BLACK
		openIceChute:
			li $t6, 0 # iterating col variable
			openIceChuteRow:
				sw $t2, 0($t4)
				addi $t4, $t4, 4
				addi $t6, $t6, 4
				blt $t6, $t5, openIceChuteRow # repeat if less than 13 times loop
			addi, $t3, $t3, 4
			sub $t4, $t4, 52
   			add $t4, $t4, 256	# go to next row
   			blt $t3, $t5, openIceChute	# repeat if less than 13 times loop
			j exitOpened
	exitOpened:
	jr $ra

checkPowerup:
	# compares the edges to the powerup colour, if touched, give powerup and erase it
	lw $t1, playerLocation
	li $t2, WHITE	# both feather and wing are white so its ok
	lw $t3, 0($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 256($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 512($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 1024($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 12($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 20($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 532($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 1036($t1)
	beq $t3, $t2, givePowerup
	lw $t3, 1044($t1)
	beq $t3, $t2, givePowerup
	jr $ra # if powerup not reached, go back
	givePowerup:
	lw $t4, level
	li $t5, 4
	li $t6, 2
	la $t2, levelBG
	add $t2, $t2, $t4
	lw $t2, 0($t2) # getting the lvl bg
	bne $t4, $t5, giveDoubleJump	# if level 3, give double jump
	# otherwise give glide and erase feather
	sw $t6, glide
	li $t4, BASE_ADDRESS
	addi $t4, $t4, 376 # gets top left corner of feather
	li $t5, 32 # max rows/cols
	li $t3, 0	# let t3 be the row iterating variable
	eraseFeather:
		li $t6, 0 # iterating col variable
		eraseFeatherRow:
			sw $t2, 0($t4)
			addi $t4, $t4, 4
			addi $t6, $t6, 4
			blt $t6, $t5, eraseFeatherRow # repeat if less than max col
		addi, $t3, $t3, 4
		sub, $t4, $t4, $t5
   		add $t4, $t4, 256	# go to next row
   		blt $t3, $t5, eraseFeather	# repeat if less than max row times loop
	jr $ra
	giveDoubleJump:
	li $t6, 1
	sw $t6, doublejump
	jr $ra

checkDamage:
	# compares the 4 corners to the kill colour, if yes, reduce health, resets level
	lw $t1, playerLocation
	lw $t3, level
	la $t2, killColour
	add $t2, $t3, $t2
	lw $t2, 0($t2) # obtains kill colour

	lw $t3, 0($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 256($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 512($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 1024($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 1028($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 1032($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 12($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 20($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 532($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 1036($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 1040($t1)
	beq $t3, $t2, reduceHealth
	lw $t3, 1044($t1)
	beq $t3, $t2, reduceHealth
	jr $ra # if health is not reduced, go back
	reduceHealth:
	lw $t4, health
	addi $t4, $t4, -4 # reduce health
	sw $t4, health
	# restart the level
	lw $t5, level
	li $t6, 4
	# if the level is 2, then also reset glide, if its 3 then reset doublejump
	bne $t5, $t6, removeDoubleJump
	li $t6, -1
	sw $t6, glide
	sw $zero, isSoy
	j gameSetup
	removeDoubleJump:
	li $t6, -1
	sw $t6, doublejump
	sw $zero, isSoy
	j gameSetup

checkWin:
	# see if any corner has touched the door (black)
	# compares the 4 corners to black, if they touch, proceed to next level
	lw $t1, playerLocation
	li $t2, BLACK
	lw $t3, 0($t1)
	beq $t3, $t2, nextLvl
	lw $t3, 1024($t1)
	beq $t3, $t2, nextLvl
	lw $t3, 20($t1)
	beq $t3, $t2, nextLvl
	lw $t3, 1044($t1)
	beq $t3, $t2, nextLvl
	jr $ra
	nextLvl:
	lw $t4, level
	addi $t4, $t4, 4 # proceed to next level
	sw $t4, level
	# set up the corresponding level
	j gameSetup

checkSeed:
	# see if any corner has touched the seed (black)
	# compares the 4 corners to seed, if they touch, evolve and add a heart
	lw $t1, playerLocation
	li $t2, SEED
	lw $t3, 0($t1)
	beq $t3, $t2, evolve
	lw $t3, 8($t1)
	beq $t3, $t2, evolve
	lw $t3, 16($t1)
	beq $t3, $t2, evolve
	lw $t3, 512($t1)
	beq $t3, $t2, evolve
	lw $t3, 528($t1)
	beq $t3, $t2, evolve
	lw $t3, 1024($t1)
	beq $t3, $t2, evolve
	lw $t3, 1032($t1)
	beq $t3, $t2, evolve
	lw $t3, 1040($t1)
	beq $t3, $t2, evolve
	jr $ra
	evolve:
	lw $t4, spritestage
	addi $t4, $t4, 4 # proceed to next sprite evolution
	
	sw $t4, spritestage
	lw $t4, seedcount
	addi $t4, $t4, 4 # count seeds obtained
	sw $t4, seedcount
	lw $t4, health	# add a heart
	addi $t4, $t4, 4
	sw $t4, health
	# set up the hearts again
	j setLives

loadWinScreen: # loads the winscreen
	la $t0, 0($s0)
    	la $t1, winnerwinner
	drawWinScreen:		# draw win screen
   	bge $t0, $s1, winScreenDrawn
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j drawWinScreen
	winScreenDrawn: # now just waits here for either quit or reset keys
		lw $t0, 4($t9) 			# reads the keyboard input
		beq $t0, 0x71, quit 		# if q is pressed, quit game
		beq $t0, 0x72, reset 		# if r is pressed, go back to start menu
	j winScreenDrawn

loadFried: # loads the lose screen
	la $t0, 0($s0)
    	la $t1, fried
	drawFriedScreen:		# draw lose screen
   	bge $t0, $s1, FriedScreenDrawn
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j drawFriedScreen
	FriedScreenDrawn: # now just waits here for either quit or reset keys
		lw $t0, 4($t9) 			# reads the keyboard input
		beq $t0, 0x71, quit 		# if q is pressed, quit game
		beq $t0, 0x72, reset 		# if r is pressed, go back to start menu
	j FriedScreenDrawn
	
reset:		# resets all variables to defaults
	sw $zero, level
   	sw $zero, hovering
   	sw $s0, playerLocation
   	sw $s0, lastLocation
   	sw $zero, direction
   	sw $zero, jumping
   	sw $zero, seedcount
   	sw $zero, spritestage
   	sw $zero, isSoy
   	li $t0, -1 # remove powerup effects
   	sw $t0, glide
   	sw $t0, doublejump
   	li $t0, 8
   	sw $t0, health
   	li $t0, DEFAULT_FRAME_RATE
   	sw $t0, frameRate
   	j loadStartMenu

quit:           
    li $v0, 10					 # quits game
    syscall	
